export const distinctBy = (as, f) => {
  const unique = [];
  for (const nxt of as) {
    if (!unique.some(a => f(a) === f(nxt))) {
      unique.push(nxt);
    }
  }
  return unique;
};
export const distinctMap = (as, f) => {
  const unique = [];
  for (const nxt of as) {
    const nxtB = f(nxt);
    if (!unique.some(b => b === nxtB)) {
      unique.push(nxtB);
    }
  }
  return unique;
};
